        <h1>Altosid<sup>&reg;</sup> Larvicides Efficacy Study</h1>
        <p>Performance matters! Check out the Altosid<sup>&reg;</sup> Larvicide Efficacy Study below. </p>
        <br />
        <div class="sxa-btn sxa-btn-primary"><a href="-/media/08C5087BD0EA49C29E853E2A7DD10DFB.ashx">DOWNLOAD STUDY</a>
        </div>
        <hr />
        <h2><span style="font-size: 16px;"><strong>PROVEN ALTOSID&reg; LARVICIDES EFFICACY STUDIES</strong></span></h2>
        <p>These graphs exemplify the larvicidal control obtained by using Altosid<sup>&reg;</sup> products. These third-party studies were conducted by Entomology Consultants in a controlled environment where every treatment group was provided the same conditions. The test species was the<em> Culex quinquefasciatus </em>in a setting simulating a typical <em>Culex</em> spp. habitat.
